package leetcode;

import org.junit.Test;

import static org.junit.Assert.assertFalse;
import static org.junit.Assert.assertTrue;

/**
 *
 */
public class RepeatedSubstringPatternTest {

    @Test
    public void repeatedSubstringPattern() {
        RepeatedSubstringPattern ins = new RepeatedSubstringPattern();

        assertTrue(ins.repeatedSubstringPattern("abab"));
        assertTrue(ins.repeatedSubstringPattern("abcabcabcabc"));
        assertFalse(ins.repeatedSubstringPattern("aba"));
        assertTrue(ins.repeatedSubstringPattern("abaababaab"));
        assertTrue(ins.repeatedSubstringPattern(""));
    }
}